import './App.css';
import Topbar from './components/Topbar';
import CardList from './components/CardList';



function App() {
  const headerStyle={
    marginLeft:'1.5rem',
    marginTop:'1.5rem',
    fontSize:'2rem',
    fontWeight:'600',
    color:'#222222'};
  return (
    <>
    <Topbar/>
    <h1 style={headerStyle}>Happening Today</h1>
    <CardList/>
    </>
  )
}

export default App;
